import React from 'react';
// css
import './web.css';
// image
import img from './img/profiles/avatar-02.jpg';
const Home = () => {
  return (
    <div className="page-wrapper" style={{height:'930px'}}>
			<div className="content container-fluid">
				<div className="page-header">
					<div className="row">
						<div className="col-sm-12 mt-5">
							<h3 className="page-title mt-3">Welcome Arun</h3>
							<ul className="breadcrumb">
								<li className="breadcrumb-item active">Dashboard</li>
							</ul>
						</div>
					</div>
				</div>
				<div className="row">
					<div className="col-xl-6 col-sm-6 col-12">
						<div className="card board1 fill">
							<div className="card-body">
								<div className="dash-widget-header">
									<div>
										<h3 className="card_widget_header">2</h3>
										<h6 className="text-muted">Totel Services</h6> </div>
									<div className="ml-auto mt-md-3 mt-lg-0"> <span className="opacity-7 text-muted"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewbox="0 0 24 24" fill="none" stroke="#009688" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-user-plus">
									<path d="M16 21v-2a4 4 0 0 0-4-4H5a4 4 0 0 0-4 4v2"></path>
									<circle cx="8.5" cy="7" r="4"></circle>
									<line x1="20" y1="8" x2="20" y2="14"></line>
									<line x1="23" y1="11" x2="17" y2="11"></line>
									</svg></span> </div>
								</div>
							</div>
						</div>
					</div>
					<div className="col-xl-6 col-sm-6 col-12">
						<div className="card board1 fill">
							<div className="card-body">
								<div className="dash-widget-header">
									<div>
										<h3 className="card_widget_header">2</h3>
										<h6 className="text-muted">Totel Users</h6> </div>
									<div className="ml-auto mt-md-3 mt-lg-0"> <span className="opacity-7 text-muted"><svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewbox="0 0 24 24" fill="none" stroke="#009688" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-file-plus">
									<path d="M14 2H6a2 2 0 0 0-2 2v16a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V8z">
									</path>
									<polyline points="14 2 14 8 20 8"></polyline>
									<line x1="12" y1="18" x2="12" y2="12"></line>
									<line x1="9" y1="15" x2="15" y2="15"></line>
									</svg></span> </div>
								</div>
							</div>
						</div>
					</div>
				</div> 
				<div style={{paddingBottom:'10px'}}>
					<h2 className="page-title mt-3">Service List</h2>
				</div>
				<div className="row">
					<div className="col-sm-12">
						<section className="pricing py-5">
							<div className="container">
							    <div className="row  mt-5">	
									<div className="col-lg-4">
										<div className="card mb-5 mb-lg-0">
										    <div className="card-body">
										        <h5 className="card-title text-muted text-uppercase text-center">Food Delivery</h5>
										        <div  style={{paddingBottom:'10px'}} className="card-price text-center mt-3"><span className="period"></span><a href="/#"> <img style={{ width: '50%', height: '50%'}} className="rounded-circle" alt="User Image" src={img} /> </a></div>
										        <a href="/home" className="btn btn-block btn-primary text-uppercase">View</a> 
										    </div>
										</div>
									</div>
									<div className="col-lg-4">
										<div className="card mb-5 mb-lg-0">
										    <div className="card-body">
										        <h5 className="card-title text-muted text-uppercase text-center">Beverages</h5>
										        <div style={{paddingBottom:'10px'}} className="card-price text-center mt-3"><span className="period"></span><a href="/#"> <img style={{ width: '50%', height: '50%'}} className="rounded-circle" alt="User Image" src={img} />  </a></div>
										        <a href="/home" className="btn btn-block btn-primary text-uppercase">View</a>
										    </div>
										</div>
									</div>
									<div className="col-lg-4">
										<div className="card mb-5 mb-lg-0">
										    <div className="card-body">
										        <h5 className="card-title text-muted text-uppercase text-center">Laundry</h5>
										        <div style={{paddingBottom:'10px'}} className="card-price text-center mt-3"><span className="period"></span><a href="/#"> <img style={{ width: '50%', height: '50%'}} className="rounded-circle" alt="User Image" src={img} />  </a></div>
